// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "./interfaces/IBusd.sol";
import "./interfaces/INonFungiblePlayer.sol";

contract NonFungiblePlayer is
    AccessControl,
    Ownable,
    ERC721URIStorage,
    INonFungiblePlayer
{
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    bytes32 public constant UPDATE_ROLE = keccak256("UPDATE_ROLE");

    address private ownerAddr;
    uint256 public blockNumber;
    uint256 public price;
    string public baseURI;
    string public cID;

    IBusd busd;

    mapping(uint256 => NfpInfo) public nfps;
    event BuyBlindBox(uint256 indexed itemId, string metaHash);
    event FusionSuccess(uint256 indexed tokenId);

    constructor(
        uint256 _blockNumber,
        IBusd _busd,
        string memory _baseURI,
        string memory _cID,
        address _ownerAddr
    ) ERC721("Non-Fungible Player", "NFP") {
        blockNumber = _blockNumber;
        busd = _busd;
        baseURI = _baseURI;
        price = 100;
        cID = _cID;
        ownerAddr = _ownerAddr;
    }

    function _rand(uint256 _modulus) internal view returns (uint256) {
        return
            uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender))) %
            _modulus;
    }

    function buyNFPBox() public {
        require(msg.sender != address(0), "Mint Address can't be zero address");
        // require(block.number >= blockNumber, "NFPBox Sale is not started");
        require(_tokenIds.current() < 256000, "All NFPs are sold");
        require(
            busd.balanceOf(msg.sender) >= price * 10**18,
            "Balance of Gol token is not enought to buy BlindBox"
        );

        busd.transferFrom(msg.sender, ownerAddr, price * 10**18);

        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        string memory s = string(
            abi.encodePacked(
                baseURI,
                cID,
                "/",
                Strings.toString(newItemId),
                ".json"
            )
        );

        string memory rarityOfNew;
        string memory positionOfNew;
        uint256 randProbability = _rand(10000);

        if (randProbability > 5500) {
            rarityOfNew = "Common";
        } else if (randProbability > 2000) {
            rarityOfNew = "Uncommon";
        } else if (randProbability > 500) {
            rarityOfNew = "Rare";
        } else if (randProbability > 100) {
            rarityOfNew = "Legendary";
        } else {
            rarityOfNew = "Mythical";
        }

        randProbability = _rand(10000);

        if (randProbability > 7500) {
            positionOfNew = "Goalie";
        } else if (randProbability > 5000) {
            positionOfNew = "Defender";
        } else if (randProbability > 2500) {
            positionOfNew = "Midfielder";
        } else {
            positionOfNew = "Striker";
        }

        nfps[newItemId] = NfpInfo(
            0,
            0,
            0,
            positionOfNew,
            rarityOfNew,
            "Rookie"
        );
        _mint(msg.sender, newItemId);
        _setTokenURI(newItemId, s);

        emit BuyBlindBox(newItemId, s);
    }

    function mintFusionedNFP(
        uint256 _tokenId1,
        uint256 _tokenId2,
        string memory _position,
        string memory _rarity,
        string memory _class
    ) external override onlyRole(UPDATE_ROLE) {
        uint256 randomNumber = _rand(10);
        string memory _tokenURI = randomNumber > 5
            ? tokenURI(_tokenId1)
            : tokenURI(_tokenId2);

        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();

        uint256 level1 = nfps[_tokenId1].level;
        uint256 level2 = nfps[_tokenId2].level;
        uint256 skillPoint1 = nfps[_tokenId1].skillPoint;
        uint256 skillPoint2 = nfps[_tokenId2].skillPoint;
        uint256 newGen = nfps[_tokenId1].gen + 1;

        nfps[newItemId] = NfpInfo(
            newGen,
            level1 > level2 ? level1 : level2,
            skillPoint1 > skillPoint2 ? skillPoint1 : skillPoint2,
            _position,
            _rarity,
            _class
        );
        _mint(msg.sender, newItemId);
        _setTokenURI(newItemId, _tokenURI);
        emit FusionSuccess(newItemId);
    }

    function updateTraitsNFP(
        uint256 _tokenId,
        uint256 _gen,
        uint256 _level,
        uint256 _skillPoint,
        string memory _position,
        string memory _rarity,
        string memory _class
    ) external override onlyRole(UPDATE_ROLE) {
        nfps[_tokenId] = NfpInfo(
            _gen,
            _level,
            _skillPoint,
            _position,
            _rarity,
            _class
        );
    }

    function setOwnerAddr(address _ownerAddr) public onlyOwner {
        require(
            _ownerAddr != address(0),
            "Owner Address can't be zero address"
        );
        ownerAddr = _ownerAddr;
    }

    function getOwnerAddr() public view onlyOwner returns (address) {
        return ownerAddr;
    }

    function setPrice(uint256 _price) public onlyOwner {
        price = _price;
    }

    function setBlockNumber(uint256 _blockNumber) public onlyOwner {
        blockNumber = _blockNumber;
    }

    function setBaseURI(string memory _baseURI) public onlyOwner {
        baseURI = _baseURI;
    }

    function setCID(string memory _cID) public onlyOwner {
        cID = _cID;
    }

    function transfer(
        address _from,
        address _to,
        uint256 _tokenId
    ) external onlyOwner {
        transferFrom(_from, _to, _tokenId);
    }

    function getBlockNumber() external view returns (uint256) {
        return block.number;
    }

    function totalSupply() external view returns (uint256) {
        return (_tokenIds.current());
    }

    function getTokenFullURI(uint256 tokenId)
        external
        view
        returns (string memory)
    {
        string memory _tokenURI = tokenURI(tokenId);

        return _tokenURI;
    }

    function getBaseURI() external view returns (string memory) {
        string memory _baseURI = baseURI;
        return _baseURI;
    }

    function fetchMyNfts() external view returns (uint256[] memory) {
        uint256 tokenCount = 0;
        uint256 _totalSupply = _tokenIds.current();
        for (uint256 i = 0; i < _totalSupply; i++) {
            if (ownerOf(i + 1) == msg.sender) {
                tokenCount++;
            }
        }

        uint256[] memory tokenIds = new uint256[](tokenCount);
        uint256 currentIndex = 0;
        for (uint256 i = 0; i < _totalSupply; i++) {
            if (ownerOf(i + 1) == msg.sender) {
                tokenIds[currentIndex] = i + 1;
                currentIndex++;
            }
        }

        return tokenIds;
    }

    function setUpdateRoleAddr(address _updateRoleAddr) public onlyOwner {
        require(
            !hasRole(UPDATE_ROLE, _updateRoleAddr),
            "Already have update role!"
        );
        _setupRole(UPDATE_ROLE, _updateRoleAddr);
    }

    function getSkillPoint(uint256 _tokenId)
        external
        view
        override
        returns (uint256)
    {
        return nfps[_tokenId].skillPoint;
    }

    function setSkillPoint(uint256 _tokenId, uint256 _skillPoint)
        external
        override
        onlyRole(UPDATE_ROLE)
    {
        NfpInfo storage _nfpInfo = nfps[_tokenId];
        _nfpInfo.skillPoint = _skillPoint;
    }

    function getGeneration(uint256 _tokenId)
        external
        view
        override
        returns (uint256)
    {
        return nfps[_tokenId].gen;
    }

    function setGeneration(uint256 _tokenId, uint256 _gen)
        external
        override
        onlyRole(UPDATE_ROLE)
    {
        NfpInfo storage _nfpInfo = nfps[_tokenId];
        _nfpInfo.gen = _gen;
    }

    function getLevel(uint256 _tokenId)
        external
        view
        override
        returns (uint256)
    {
        return nfps[_tokenId].level;
    }

    function setLevel(uint256 _tokenId, uint256 _level)
        external
        override
        onlyRole(UPDATE_ROLE)
    {
        NfpInfo storage _nfpInfo = nfps[_tokenId];
        _nfpInfo.level = _level;
    }

    function getPosition(uint256 _tokenId)
        external
        view
        override
        returns (string memory)
    {
        return nfps[_tokenId].position;
    }

    function setPosition(uint256 _tokenId, string memory _position)
        external
        override
        onlyRole(UPDATE_ROLE)
    {
        NfpInfo storage _nfpInfo = nfps[_tokenId];
        _nfpInfo.position = _position;
    }

    function getRarity(uint256 _tokenId)
        external
        view
        override
        returns (string memory)
    {
        return nfps[_tokenId].rarity;
    }

    function setRarity(uint256 _tokenId, string memory _rarity)
        external
        override
        onlyRole(UPDATE_ROLE)
    {
        NfpInfo storage _nfpInfo = nfps[_tokenId];
        _nfpInfo.rarity = _rarity;
    }

    function getClass(uint256 _tokenId)
        external
        view
        override
        returns (string memory)
    {
        return nfps[_tokenId].class;
    }

    function setClass(uint256 _tokenId, string memory _class)
        external
        override
        onlyRole(UPDATE_ROLE)
    {
        NfpInfo storage _nfpInfo = nfps[_tokenId];
        _nfpInfo.class = _class;
    }

    function burn(uint256 tokenId) external override onlyRole(UPDATE_ROLE) {
        _burn(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC721, IERC165, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
